import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from "axios";

class App extends React.Component {
  constructor(){
    super();
    this.state = {
      students : []
    }
  }
  componentDidMount() {
    axios.get("http://127.0.0.1:8000/students/14010696401/").then(
      (res) => console.log(res)
    )
    /console.log(fetch("http://127.0.0.1:8000/students/"))
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
         <div>
           {this.state.students}
         </div>
        </header>
      </div>
    );
  }

}

export default App;
